import React from 'react';

export const Input = ({ label, name, type }) => {
    return (
        <div className="form-input">
            <label>{label}</label>
            <input 
                type={type} 
                autoComplete="off" 
                name={name}
            />
        </div>
    )
}

export const Textarea = ({label, name}) => {
    return (
        <div className="form-textarea">
            <label>{label}</label><br />
            <textarea  
                autoComplete="off" 
                name={name}
            />
        </div>
    )
}
